// src/components/TableView.jsx
import React, { useEffect, useState } from 'react';
import { useStateContext } from '../context/StateContext';
import { useNavigate } from 'react-router-dom';

const TableView = () => {
  const { normalizedTables, filename } = useStateContext(); 
  const navigate = useNavigate();

  const [activeTable, setActiveTable] = useState(null);

  // Debugging
  useEffect(() => {
    console.log("Normalized Tables received:", normalizedTables);
    if (normalizedTables && Object.keys(normalizedTables).length > 0) {
      setActiveTable(Object.keys(normalizedTables)[0]); // default to first table
    }
  }, [normalizedTables]);

  if (!normalizedTables || Object.keys(normalizedTables).length === 0) {
    return (
      <div style={{ padding: '20px', color: 'red' }}>
        <p>⚠️ No normalized tables found for this file.</p>
        <button onClick={() => navigate(-1)}>Go Back</button>
      </div>
    );
  }

  return (
    <div className="glass-container" style={{ padding: '20px' }}>
      <header>
        <h1>🧩 Normalized Tables (3NF)</h1>
      </header>

      {/* Table Navigation */}
      <section className="navigation-section">
        <div className="table-buttons" style={{ marginBottom: '15px' }}>
          {Object.keys(normalizedTables).map((tableName) => (
            <button
              key={tableName}
              className={`toggle-btn ${activeTable === tableName ? 'active' : ''}`}
              onClick={() => setActiveTable(tableName)}
              aria-label={`Show table ${tableName}`}
              style={{
                marginRight: '10px',
                padding: '8px 12px',
                borderRadius: '6px',
                cursor: 'pointer',
                backgroundColor: activeTable === tableName ? '#50fa7b' : '#44475a',
                color: '#fff',
                border: 'none'
              }}
            >
              {tableName}
            </button>
          ))}
        </div>
      </section>

      {/* Table Display */}
      <section className="tables-display">
        {Object.entries(normalizedTables).map(([tableName, rows]) => {
          if (tableName !== activeTable) return null;

          // Filter rows like your original TableView
          const cleanRows = Array.isArray(rows)
            ? rows.filter(row =>
                Array.isArray(row) &&
                !row.some(cell =>
                  cell === null ||
                  cell === undefined ||
                  (typeof cell === 'number' && isNaN(cell))
                )
              )
            : [];

          if (cleanRows.length === 0) {
            return <p key={tableName}>Table exists but contains no valid rows.</p>;
          }

          return (
            <div
              key={tableName}
              className="table-container"
              role="region"
              aria-labelledby={`heading-${tableName}`}
            >
              <h2 id={`heading-${tableName}`}>📋 {tableName}</h2>
              <div className="table-wrapper" style={{ overflowX: 'auto' }}>
                <table className="excel-table" style={{ borderCollapse: 'collapse', width: '100%' }}>
                  <thead>
                    <tr>
                      {cleanRows[0].map((col, idx) => (
                        <th key={idx} style={{ border: '1px solid #ddd', padding: '8px', backgroundColor: '#f2f2f2' }}>
                          {col}
                        </th>
                      ))}
                    </tr>
                  </thead>
                  <tbody>
                    {cleanRows.slice(1).map((row, i) => (
                      <tr key={i}>
                        {row.map((cell, j) => (
                          <td key={j} style={{ border: '1px solid #ddd', padding: '8px' }}>
                            {cell === null || cell === undefined || (typeof cell === 'number' && isNaN(cell))
                              ? 'N/A'
                              : String(cell)}
                          </td>
                        ))}
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          );
        })}
      </section>

      {/* Action Buttons */}
      <section className="button-section" style={{ marginTop: '30px' }}>
        <div className="back-btn" style={{ marginBottom: '10px' }}>
          <button onClick={() => navigate(`/fds/${filename}`)}>← Back to FDs</button>
        </div>

        <div className="back-btn" style={{ marginBottom: '10px' }}>
          <button onClick={() => navigate(`/keys/${filename}`)}>Show Keys</button>
        </div>

        <div className="back-btn" style={{ marginBottom: '10px' }}>
          <button onClick={() => navigate(`/conditions/${filename}`)}>
            View 1NF & 2NF & 3NF Conditions
          </button>
        </div>

        <div className="back-btn">
          <button onClick={() => navigate(`/er-diagram/${filename}`)}>Generate Relational Model</button>
        </div>
      </section>
    </div>
  );
};

export default TableView;
